import React from 'react';
// import './auth.css'

const AuthPage = ({title}) => {
    return (
        <div className="auth">
            {title}
            <div>This is auth page</div>
        </div>
    );
};
AuthPage.getInitialProps = context => {
    console.log("context: ", context)
    return {title: 'Auth Page Title'}
}

export default AuthPage;
